import React,{useState,useEffect} from 'react';



function Main() {
	const [moviedata,setMoviedata]=useState("");
	useEffect(() => {
    fetch("https://api.themoviedb.org/3/movie/upcoming?api_key=a0d1ccffb7077d4acb8d946b535565ac&language=en-US&page=1")
    .then(response => response.json())

    .then(data => setMoviedata(data))
	console.log(moviedata);
  },[moviedata]);

  return (
  <>
<div className="container">
	{moviedata && moviedata.map((mdata=>{
	return(
	<>
		 <div class="card" >
			  <img class="card-img-top" src="mdata.poster_path" alt="not loading"/>
			  <div class="card-body">
				  <h5 class="card-title">mdata.original_title</h5>
				  <h4 class="card-text">mdata.vote_average</h4>
				  <p class="card-text">mdata.overview </p>
			  </div>
		 </div>
	</> 
		 );
	}))}
</div>
 </>
  );
}

export default Main;
